import React from 'react';
import './Home.scss';

function HomeTimeLine({ homeTimeLineTweets }) {
    const listOfHomeLineTweets = () => {
        return homeTimeLineTweets.reverse().map((tweet, index) => {
            console.log("tweet", tweet)
            return <div className="tweet-container">
                <div className="tweet-profile-pic">
                    <img src={tweet.user.profile_image_url_https} />
                </div>

                <div className="tweet-content">

                </div>
            </div>;
        });
    };

    return (
        <div className="main-content-spacing">
            <listOfHomeLineTweets />
        </div>
    );
};

export default HomeTimeLine;
